import { useState, useEffect } from 'react';
import { Link } from 'react-scroll';
import axios from 'axios';
import 'animate.css';
import './App.css';

function App() {
  const [skills, setSkills] = useState([]);
  const [projects, setProjects] = useState([]);
  const [certificates, setCertificates] = useState([]);
  const [contactForm, setContactForm] = useState({ name: '', email: '', message: '' });
  const [formStatus, setFormStatus] = useState('');

  useEffect(() => {
    axios.get('http://localhost:5000/api/skills').then(res => setSkills(res.data));
    axios.get('http://localhost:5000/api/projects').then(res => setProjects(res.data));
    axios.get('http://localhost:5000/api/certificates').then(res => setCertificates(res.data));
  }, []);

  const handleContactSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:5000/api/contact', contactForm);
      setFormStatus('Message sent successfully!');
      setContactForm({ name: '', email: '', message: '' });
    } catch (error) {
      setFormStatus('Failed to send message.');
    }
  };

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Navbar */}
      <nav className="bg-black text-white p-4 fixed w-full top-0 z-10 shadow-lg">
        <div className="container mx-auto flex justify-between items-center">
          <div className="text-2xl font-bold animate__animated animate__fadeInLeft">Panga Syamsundar Rao</div>
          <div className="space-x-4">
            {['Home', 'Skills', 'Projects', 'Certificates', 'Experience', 'About', 'Contact'].map(item => (
              <Link
                key={item}
                to={item.toLowerCase()}
                smooth={true}
                duration={500}
                className="cursor-pointer hover:text-gray-300 transition-colors duration-300"
              >
                {item}
              </Link>
            ))}
          </div>
        </div>
      </nav>

      {/* Home */}
      <section id="home" className="min-h-screen flex items-center justify-center bg-gray-200">
        <div className="container mx-auto flex flex-col md:flex-row items-center justify-between px-4 animate__animated animate__fadeIn">
          <div className="md:w-1/2 text-center md:text-left mb-8 md:mb-0">
            <h1 className="text-4xl font-bold mb-4 animate__animated animate__fadeInUp">Welcome to My Portfolio</h1>
            <p className="text-lg leading-relaxed animate__animated animate__fadeInUp animate__delay-1s">
              I am a well-organized, energetic, and goal-oriented fresher, possessing positive attitude, problem-solving,
              and leadership skills with flair to explore suitable avenues in software development with good knowledge in
              Java, frontend development, C, and Oracle. To work in an organization that provides me with ample
              opportunities to enhance my skills and knowledge along with contributing to the growth of the organization.
            </p>
          </div>
          <div className="md:w-1/2 flex justify-center">
            <img
              src="public/syam.webp"
              alt="Panga Syamsundar Rao"
              className="w-64 h-64 rounded-full shadow-lg object-cover transform hover:scale-105 transition-transform duration-300 animate__animated animate__zoomIn"
            />
          </div>
        </div>
      </section>

      {/* Skills */}
      <section id="skills" className="py-16 bg-white animate__animated animate__fadeInUp">
        <div className="container mx-auto">
          <h2 className="text-3xl font-bold text-center mb-8">Skills</h2>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            {skills.map(skill => (
              <div
                key={skill.id}
                className="p-4 bg-gray-100 rounded-lg shadow-md hover:shadow-xl transition-shadow duration-300"
              >
                {skill.name}
              </div>
            ))}
          </div>
        </div>
      </section>

      {/* Projects */}
      <section id="projects" className="py-16 bg-gray-100 animate__animated animate__fadeInUp">
        <div className="container mx-auto">
          <h2 className="text-3xl font-bold text-center mb-8">Projects</h2>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            {projects.map(project => (
              <div
                key={project.id}
                className="p-4 bg-white rounded-lg shadow-md hover:shadow-xl transition-shadow duration-300"
              >
                <h3 className="text-xl font-bold">{project.title}</h3>
                <p>{project.description}</p>
                <a
                  href={project.link}
                  target="_blank"
                  rel="noopener noreferrer"
