            {certificates.map(cert => (
              <div
                key={cert.id}
                className="p-4 bg-gray-100 rounded-lg shadow-md hover:shadow-xl transition-shadow duration-300"
              >
                <h3 className="text-xl font-bold">{cert.name}</h3>
                <p>{cert.issuer} - {cert.year}</p>
