            passionate about software development, with expertise in Java, React, Spring Boot, and MySQL. I am a
            well-organized, energetic, and goal-oriented individual with strong problem-solving and leadership skills.
          </p>
        </div>
      </section>

      {/* Contact */}
      <section id="contact" className="py-16 bg-gray-100 animate__animated animate__fadeInUp">
        <div className="container mx-auto">
          <h2 className="text-3xl font-bold text-center mb-8">Contact Me</h2>
          <form onSubmit={handleContactSubmit} className="max-w-lg mx-auto">
            <div className="mb-4">
              <label className="block text-lg mb-2">Name</label>
              <input
                type="text"
                value={contactForm.name}
                onChange={e => setContactForm({ ...contactForm, name: e.target.value })}
                className="w-full p-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-black transition-all duration-300"
                required
              />
            </div>
            <div className="mb-4">
              <label className="block text-lg mb-2">Email</label>
              <input
                type="email"
                value={contactForm.email}
                onChange={e => setContactForm({ ...contactForm, email: e.target.value })}
                className="w-full p-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-black transition-all duration-300"
                required
              />
            </div>
            <div className="mb-4">
              <label className="block text-lg mb-2">Message</label>
              <textarea
                value={contactForm.message}
                onChange={e => setContactForm({ ...contactForm, message: e.target.value })}
                className="w-full p-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-black transition-all duration-300"
                rows="5"
                required
              ></textarea>
            </div>
            <button
              type="submit"
              className="bg-black text-white p-2 rounded-lg hover:bg-gray-800 transition-colors duration-300 w-full"
            >
              Send Message
            </button>
            {formStatus && <p className="mt-4 text-center text-gray-700">{formStatus}</p>}
          </form>
        </div>
      </section>

      {/* Footer */}
      <footer className="bg-black text-white py-4 shadow-lg">
        <div className="container mx-auto flex justify-center space-x-4 animate__animated animate__fadeInUp">
